import logo from  '../Images/logo-mimate.png'

const logoTamaño= {
    width: '10rem',
    height: '10rem'
}

function NavBarLogo() {
    return (
      <div>
            <div></div>
                <img src={logo} className="img-fluid" style={logoTamaño}></img>
                <h2 className='NavBar-Brand'>SyA MiMate</h2>
                <a href='#' className='Link-Light'>Home</a>
                <a href='#' className='Link-Light'>Mates</a>
                <a href='#' className='Link-Light'>Bombillas</a>
                <a href='#' className='Link-Light'>Yerbas</a>
                <a href='#' className='Link-Light'>Termos</a>
                <a href='#' className='Link-Light'>Accesorios</a>
      </div>
    );
  }
  
  export default NavBarLogo;
